.Select(offset => cinemaMovie.FromDate.AddDays(offset))
.ToArray();
                foreach (var date in dates)
                {
                    for (int j = 0; j < 3; j++)
                    {
                        var item = new CinemaMovieTime
                        {
                            Id = (i + 1),
                            CinemaId = cinemaMovie.CinemaId,
                            MovieId = cinemaMovie.MovieId,
                            ForDateTime = new DateTime(date.Year, date.Month, date.Day, new Random().Next(8, 24), new int[] { 0, 10, 15, 20, 30, 40, 45, 50 }[new Random().Next(8)], 0)
                        };
